import React from 'react';

import Navbar from '../components/Navbar';
import '../styles/Badges.css';

class Badges extends React.Component {
    render() {
        return (
            <div>
                <Navbar />

                <div className="Badges">
                    <div className="Badges__hero"></div>
                </div>
            </div>
        )
    };
}

export default Badges;
